import React from "react";
import "./App.css";
import Dashboard from "./components/Dashboard/Dashboard";
import TextSection from "./components/Dashboard/TextSection/TextSection";
import TableSection from "./components/Dashboard/TableSection/TableSection";
import ChartSection from "./components/Dashboard/ChartSection/ChartSection";
import OverviewSection from "./components/Dashboard/OverviewSection/OverviewSection";

const App: React.FC = () => {
  type Order = {
    id: number;
    name: string;
    date: string;
    amount: number;
  };

  const [orders, setOrders] = React.useState<Order[]>([]);

  return (
    <div className='App'>
      <Dashboard>
        <OverviewSection orders={orders} />
        <TextSection />
        <TableSection />
        <ChartSection />
      </Dashboard>
    </div>
  );
};

export default App;
